import React from 'react';
import { WiDayCloudyGusts } from "react-icons/wi";

function Navbar() {

    return (
        <div className="sticky top-0 m-0 flex justify-between max-w-7xl mx-auto z-99 p-1 text-xl font-mono text-stone-300 items-center bg-header-primary">
            <div className='flex flex-row justify-between items-center p-1 '>
                <WiDayCloudyGusts size={60} /><span className='font-semibold tracking-wider'>&nbsp;Daily Weather App
                </span>
            </div>
            <p className="text-center items-center p-1 cursor-pointer tracking-tighter">
                {new Date().toDateString()}
            </p>
        </div>
    )
}

export default Navbar
